    public static int lengthOfLongestSubstring(String s) {
        HashMap<Character, Boolean> currentSub = new HashMap<>();
        char[] charArray = s.toCharArray();
        int maxCount = 0, lastIndex = 0;

        long t1 = System.currentTimeMillis();

        for (int i = 0; i < s.length(); i++) {
            char c = charArray[i];

            if (currentSub.containsKey(c)) {
                if (currentSub.size() > maxCount)
                    maxCount = currentSub.size();

                currentSub.clear();

                i = lastIndex;
                lastIndex = i + 1;
            } else {
                currentSub.put(c, true);
            }
        }

        long t2 = System.currentTimeMillis();

        System.out.println(t2 - t1);
        
        return Math.max(currentSub.size(), maxCount);
    }
